import React from "react";
import {Link, Navlink} from "react-router-dom"

function Navbar(){
    return(
        <div className="navbar">
            <NavLink className="nav-link" to="/sports/football">Football</NavLink>
            <NavLink className="nav-link" to="/sports/cricket">Cricket</NavLink>
            <NavLink className="nav-link">TED Talks</NavLink>
            <NavLink className="nav-link">Hackathons</NavLink>
            <NavLink className="nav-link">World Programming Competitions</NavLink>
        </div>
    )
}

export default Navbar;
